//React functional control with import (rfce)
import { List, ListItem, ListItemText } from '@material-ui/core'
import React from 'react'

function Todo(props) {
    return (
        <List>
            <ListItem>
                <ListItemText>{props.text}</ListItemText>
            </ListItem>
        </List>
    )
}

export default Todo
